import React from 'react'
import { Helmet } from 'react-helmet'

// import VTSFcarousel from '../component/VTSFcarousel'

const Gallery = ({ EventInfoForTransfer }) => {
  return (
    <div>
        <Helmet>
            <title>VTSF | Gallery</title>
        </Helmet>
    </div>
  )
}

export default Gallery
